import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom'; 
// para instalar rodar o comando npm install react-router-dom


import ProgCientifica from './pages/ProgramacaoCientifica';

export default function Routes(){

    return (
        <BrowserRouter>
            <Switch>
                <Route exact path={`${this.props.location.pathname}/`} exact component={ ProgCientifica } />
                <Route exact path={`${this.props.location.pathname}/progcientifica`} component={ ProgCientifica } />

            </Switch>
        </BrowserRouter>
    )
}
